Xây dựng văn bản gửi các doanh nghiệp, nhà máy, Hiệp hội có liên quan đến ôxy y tế tổ chức rà soát và báo cáo: 
+ Khả năng cung ứng ôxy y tế, số lượng các Bình/bồn/chai chứa và các thiết bị liên quan; 
+ Phương án chuyển đổi bình/chai khí công nghiệp sang sử dụng trong y tế, thời gian chuyển đổi dự kiến. Cần nghiên cứu và hoàn thiện bộ câu hỏi rõ ràng, cụ thể để có kế hoạch đưa dữ liệu vào ứng dụng Công nghệ thông tin theo dõi, báo cáo.
